"use client"

import { useState } from "react"
import "./UploadPage.css"

const API_BASE_URL = process.env.REACT_APP_API_URL || "http://localhost:5000"

const UploadPage = () => {
  const [file, setFile] = useState(null)
  const [preview, setPreview] = useState(null)
  const [extractedText, setExtractedText] = useState("")
  const [isProcessing, setIsProcessing] = useState(false)
  const [progress, setProgress] = useState(0)
  const [ocrMethod, setOcrMethod] = useState("")
  const [logs, setLogs] = useState([])

  const addLog = (message) => {
    const timestamp = new Date().toLocaleTimeString()
    setLogs((prev) => [...prev, `[${timestamp}] ${message}`])
    console.log(message)
  }

  const handleFileChange = (e) => {
    const selectedFile = e.target.files?.[0]
    if (selectedFile) {
      // Validate file
      if (!selectedFile.type.startsWith("image/")) {
        alert("Please select an image file")
        return
      }

      if (selectedFile.size > 10 * 1024 * 1024) {
        alert("File too large. Please select an image smaller than 10MB")
        return
      }

      setFile(selectedFile)
      addLog(`File selected: ${selectedFile.name} (${Math.round(selectedFile.size / 1024)}KB)`)

      // Create preview
      const reader = new FileReader()
      reader.onload = (e) => setPreview(e.target.result)
      reader.readAsDataURL(selectedFile)
    }
  }

  const processWithTesseract = async (imageData) => {
    try {
      addLog("Loading Tesseract.js...")
      const { createWorker } = await import("tesseract.js")

      setProgress(0)
      const worker = await createWorker("eng", 1, {
        logger: (m) => {
          if (m.status === "recognizing text") {
            setProgress(Math.round(m.progress * 100))
          }
        },
      })

      addLog("Configuring Tesseract for handwriting...")
      await worker.setParameters({
        tessedit_char_whitelist: "ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789.,:-/() ",
        tessedit_pageseg_mode: "6",
      })

      addLog("Processing image with Tesseract...")
      const {
        data: { text, confidence },
      } = await worker.recognize(imageData)
      await worker.terminate()

      return { text: text.trim(), confidence }
    } catch (error) {
      addLog(`Tesseract error: ${error.message}`)
      throw error
    }
  }

  const processImage = async () => {
    if (!file) return

    setIsProcessing(true)
    setProgress(0)
    setOcrMethod("")
    setExtractedText("")
    setLogs([])

    try {
      addLog("Starting OCR process...")

      // First try server-side OCR
      const formData = new FormData()
      formData.append("image", file)

      addLog("Sending image to server...")
      const response = await fetch(`${API_BASE_URL}/api/ocr`, {
        method: "POST",
        body: formData,
      })

      if (!response.ok) {
        throw new Error(`Server error: ${response.status}`)
      }

      const data = await response.json()
      addLog(`Server response: ${data.success ? "Success" : "Failed"}`)

      if (data.success) {
        if (data.text && data.method !== "client-side") {
          // Server-side OCR successful
          setExtractedText(data.text)
          setOcrMethod(data.method)
          addLog(`‚úÖ Text extracted using ${data.method}`)
          addLog(`üìù Extracted ${data.text.length} characters`)
        } else {
          // Use client-side OCR
          setOcrMethod("Tesseract.js (Client-side)")
          addLog("üîÑ Using client-side OCR...")

          const imageData = data.imageData || preview
          const result = await processWithTesseract(imageData)
          setExtractedText(result.text)

          addLog(`‚úÖ Text extracted with ${Math.round(result.confidence)}% confidence`)
          addLog(`üìù Extracted ${result.text.length} characters`)
        }
      } else {
        throw new Error(data.error || "Failed to process image")
      }
    } catch (error) {
      addLog(`‚ùå Error: ${error.message}`)
      alert(`Error: ${error.message}`)
    } finally {
      setIsProcessing(false)
      setProgress(0)
    }
  }

  const createOrder = async () => {
    if (!extractedText) return

    try {
      addLog("Creating order...")
      const response = await fetch(`${API_BASE_URL}/api/orders`, {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({ prescriptionText: extractedText }),
      })

      const data = await response.json()

      if (data.success) {
        addLog(`‚úÖ Order created: ${data.orderId}`)
        alert(`Order #${data.orderId} created successfully!`)

        // Reset form
        setFile(null)
        setPreview(null)
        setExtractedText("")
        setOcrMethod("")
      } else {
        throw new Error(data.error)
      }
    } catch (error) {
      addLog(`‚ùå Order creation failed: ${error.message}`)
      alert(`Failed to create order: ${error.message}`)
    }
  }

  const testConnection = async () => {
    try {
      addLog("Testing server connection...")
      const response = await fetch(`${API_BASE_URL}/api/health`)
      const data = await response.json()
      addLog(`‚úÖ Server connected: ${data.message}`)
    } catch (error) {
      addLog(`‚ùå Server connection failed: ${error.message}`)
    }
  }

  return (
    <div className="upload-page">
      <div className="container">
        <h1>Upload Prescription</h1>

        {/* Debug Panel */}
        <div className="debug-panel">
          <h3>üîß Debug Panel</h3>
          <button onClick={testConnection} className="btn btn-secondary">
            Test Server Connection
          </button>
          <div className="logs">
            {logs.map((log, index) => (
              <div key={index} className="log-entry">
                {log}
              </div>
            ))}
          </div>
        </div>

        <div className="upload-grid">
          {/* Upload Section */}
          <div className="upload-section">
            <h2>üì§ Upload Image</h2>

            <div className="file-drop-zone">
              {preview ? (
                <div className="preview-container">
                  <img src={preview || "/placeholder.svg"} alt="Preview" className="preview-image" />
                  <div className="file-info">
                    üìÅ {file?.name} ({Math.round((file?.size || 0) / 1024)}KB)
                  </div>
                </div>
              ) : (
                <div className="drop-placeholder">
                  <div className="drop-icon">üì∑</div>
                  <p>Select an image file</p>
                  <p className="file-hint">Max size: 10MB</p>
                </div>
              )}
            </div>

            <input
              type="file"
              accept="image/*"
              onChange={handleFileChange}
              disabled={isProcessing}
              className="file-input"
            />

            {isProcessing && (
              <div className="progress-container">
                <div className="progress-info">
                  Processing with {ocrMethod}
                  {progress > 0 && <span> - {progress}%</span>}
                </div>
                {progress > 0 && (
                  <div className="progress-bar">
                    <div className="progress-fill" style={{ width: `${progress}%` }}></div>
                  </div>
                )}
              </div>
            )}

            <button onClick={processImage} disabled={!file || isProcessing} className="btn btn-primary">
              {isProcessing ? "‚è≥ Extracting Text..." : "üîç Extract Text"}
            </button>

            {ocrMethod && (
              <div className="ocr-info">
                <p>‚úÖ Processed using: {ocrMethod}</p>
                {extractedText && <p>üìù {extractedText.length} characters extracted</p>}
              </div>
            )}
          </div>

          {/* Text Section */}
          <div className="text-section">
            <h2>üìù Extracted Text</h2>

            <textarea
              placeholder="Extracted text will appear here..."
              value={extractedText}
              onChange={(e) => setExtractedText(e.target.value)}
              rows={15}
              className="text-area"
            />

            <div className="button-group">
              <button onClick={createOrder} disabled={!extractedText} className="btn btn-success">
                ‚úÖ Create Order
              </button>
              <button onClick={() => setExtractedText("")} disabled={!extractedText} className="btn btn-secondary">
                üóëÔ∏è Clear
              </button>
            </div>
          </div>
        </div>
      </div>
    </div>
  )
}

export default UploadPage
